import React from 'react';
import style from './starry.jpg';
import contents from './mountains.jpeg';
import output from './output.png';


const NSTExample = () => {
  return (
    <div className='dib flex-wrap'>
      <img className='ma4  center dib' style={{width: '450px', height: '450px' }} src={contents} alt='' title='Take your favourite pic' />
      <figcaption>Caption goes here</figcaption>
      <img className='ma4  center dib' style={{width: '450px', height: '450px' }} src={style} alt='' />
      <figcaption>Caption goes here</figcaption>
      <img className='ma4  center dib' style={{width: '450px', height: '450px' }} src={output} alt='' />
      <figcaption>Caption goes here</figcaption>
    </div>
  );
}

export default NSTExample
